import React from 'react';

export default function ActionButton({
    children,
    onClick,
    type = 'button',
    className = '',
    disabled = false,
    style = {},
    ...props
}) {
    return (
        <button
            type={type}
            className={`action-btn ${className}`}
            onClick={onClick}
            disabled={disabled}
            style={style}
            {...props}
        >
            {children}
        </button>
    );
}
